C.qZA()()()()()(),C.TgZ(16,"div",6)(17,"div",2)(18,"h2"),C._uU(19,"Profile"),C.qZA(),C.TgZ(20,"p"),C._uU(21," I am a positive, driven and enthusiastic person. I love testing and building software. I enjoy learning about new methodologies, test heuristics, tools and libraries that I can try out and see how I can then incorporate them into my day to day role. I Have given talks on BDD and automation. The Introduction to BDD talk was at the North East Testaltelier. The introduction to writing UI automation talk, I presented at the north east agile tester, Newcastle MOT meetup and at a Leeds testing Meetup. Over the course of my career I have ran numerous workshops for teams across Sage and SolarWinds/N-able. I have helped development teams at Sage and Solarwinds/N-able become more integrated and helped them implement agile principles and practices (specifically BDD) to improve their teamwork and also the quality of their releases. I have a half day workshop which I created and have used to teach engineers and stakeholders about the benefits of more integrated working practices. "),C.qZA()(),C.TgZ(22,"div",2)(23,"h2"),C._uU(24,"Skills"),C.qZA()(),C.TgZ(25,"div",7)(26,"div",8)(27,"h2"),C._uU(28,"Testing"),C.qZA(),C.TgZ(29,"p"),C._uU(30,"Competent and confident in my ability to manage the full testing lifecycle of a product, from static analysis of requirements at the start, in step automation checks using the principles of BDD to guide their creation, then to manual testing and issue track and finally through to deployment and post deployment sanity testing. I have written and maintained multiple automation frameworks from scratch using a variety of tools and languages and enjoy sharing this knowledge whenever possible."),C.qZA()(),C.TgZ(31,"div",8)(32,"h2"),C._uU(33,"Software Development"),C.qZA(),C.TgZ(34,"p"),C._uU(35,"I am most at home when writing C#, I have built microservices using asp.net, along with maintaining them and adding new features to them over time. I have experience in writing and maintaining CI/CD pipelines and deploying services through to production via those pipelines. I have dabbled in app creation and have recently started to learn front end development using angular too. I am happy to turn my hand to anything and believe that writing the code is one small part of building great software."),C.qZA()(),C.TgZ(36,"div",8)(37,"h2"),C._uU(38,"Project Management"),C.qZA(),C.TgZ(39,"p"),C._uU(40,"I have a lot of experience as a scrum master, I have a great wealth of experience with taking requirements from Product management, converting those requirements into backlog items and then organise and present that backlog to teams, working with teams to then refine those tickets, and then develop and test those tickets all the way through to them being delivered to production. I prefer to use parts of the SAFe namely PI planning as a means to scope and refine deliverables and am a fan of example mapping as a means to break down requirements and tickets."),C.qZA()()(),C.TgZ(41,"div",2)(42,"h2"),C._uU(43,"Technical"),C.qZA()(),C.TgZ(44,"div",7)(45,"ul",8)(46,"li"),C._uU(47,"UI Automation "),C.TgZ(48,"ul")(49,"li"),C._uU(50,"Selenium"),C.qZA(),C.TgZ(51,"li"),C._uU(52,"Protractor"),C.qZA(),C.TgZ(53,"li"),C._uU(54,"Playwright"),C.qZA(),C.TgZ(55,"li"),C._uU(56,"WebdriverIO"),C.qZA(),C.TgZ(57,"li"),C._uU(58,"Xamarin UITest"),C.qZA()()(),C.TgZ(59,"li"),C._uU(60,"Api Automation"),C.qZA(),C.TgZ(61,"li"),C._uU(62,"Load Automation "),C.TgZ(63,"ul")(64,"li"),C._uU(65,"K6"),C.qZA(),C.TgZ(66,"li"),C._uU(67,"JMeter"),C.qZA()()()(),C.TgZ(68,"ul",8)(69,"li"),C._uU(70,"Typescript"),C.qZA(),C.TgZ(71,"li"),C._uU(72,"Javascript"),C.qZA(),C.TgZ(73,"li"),C._uU(74,"C# "),C.TgZ(75,"ul")(76,"li"),C._uU(77,"Asp.net"),C.qZA(),C.TgZ(78,"li"),C._uU(79,"Nunit"),C.qZA(),C.TgZ(80,"li"),C._uU(81,"Refit"),C.qZA(),C.TgZ(82,"li"),C._uU(83,"Entity Framework"),C.qZA(),C.TgZ(84,"li"),C._uU(85,"Moq"),C.qZA(),C.TgZ(86,"li"),C._uU(87,"Fluent Assertions"),C.qZA(),C